#include <stdio.h>
#include <stdint.h>
#include <stdlib.h>

typedef struct {
    uint64_t from;
    uint64_t to;
    uint64_t val;
} NumberRange;

extern NumberRange table[];

char *read_file(const char *file_name) {
    FILE *fp;
    long lSize;
    char *buffer;

    fp = fopen (file_name , "rb" );
    if( !fp ) perror(file_name),exit(1);

    fseek( fp , 0L , SEEK_END);
    lSize = ftell( fp );
    rewind( fp );

    buffer = calloc( 1, lSize+1 );
    if( !buffer ) fclose(fp),fputs("memory alloc fails",stderr),exit(1);

    if( 1!=fread( buffer , lSize, 1 , fp) )
    fclose(fp),free(buffer),fputs("entire read fails",stderr),exit(1);

    fclose(fp);
    return buffer;
}

uint32_t index_of_el(uint64_t el) {
    uint32_t l = 0;
    uint32_t r = 99999;
    while (l < r) {
        uint32_t m = (l + r) / 2;
        if (el < table[m].from) {
            r = m;
        } else if (el > table[m].to) {
            l = m + 1;
        } else {
            return m;
        }
    }
    return 0;
}



int main(void) {
    char *text = read_file("/home/eron/Documents/Programming/C/Advent-of-Code-2025/day 2/input.txt");
    size_t i = 0;
    uint64_t a = 0;
    uint64_t b = 0;
    int is_a = 1;
    uint64_t res = 0;
    while(text[i] != '\0') {
        if (text[i] == ',') {
            res += table[index_of_el(b)].val - table[index_of_el(a-1)].val;
            a = 0;
            b = 0;
            is_a = 1;
        } else if (text[i] == '-') {
            is_a = 0;
        } else if (is_a) {
            a *= 10;
            a += text[i] - '0';
        } else {
            b *= 10;
            b += text[i] - '0';
        }
        i++;
    }
    res += table[index_of_el(b)].val - table[index_of_el(a-1)].val;
    printf("%ld\n", res);
    return 0;
}

